Avec BNI mobile, votre banque vous accompagne partout sur votre smartphone ou votre tablette. L’ app vous offre toutes les possibilités et fonctionnalités nécessaires à vos opérations bancaires quotidiennes. 

Voici quelques-unes des nombreuses possibilités qu'offre l'app BNI mobile:

• se connecter facilement et en toute sécurité avec mot de passe et reconnaissance de l'appareil ;
• consulter les avoirs de vos comptes à vue et d'épargne ;
• examiner les opérations effectuées les mois antérieurs ;
• connaître les dépenses que vous avez déjà effectuées au cours du mois avec votre carte de crédit ;
• effectuer des virements;
• gérer vos comptes bénéficiaires ;
• consulter vos extraits de compte ;
• avec Paiement Facture, payer d'un simple clic les factures de vos fournisseurs d'eau, d'électricité;
• faites vos retraits sans cartes ;

BNI mobile vous offre un confort d'utilisation maximal, grâce à un design attrayant, des visuels clairs et une navigation facile.

BNI mobile est un service complémentaire à WEB BNI. Il est directement accessible à tous les clients bancarisés de la BNI ayant souscris à ce service. Téléchargez l'app gratuitement. Vous pouvez l'utiliser immédiatement.

The MT Health Entitlement Application can be used by the citizen to interact with Malta Ministry for Health and Healthcare Providers for several use cases:
       •	Request, Renew, Cancel EHIC;
       •	Request, Cancel RHA;
       •	Check Eligibility;
       •	Request for Information.

The application will allow the citizen to send requests to Ministry for Health to keep track of the progress and the status of the requests, as well as to interact with the ministry through the transfer of electronic forms and attachments.

The application will inform the citizen with regards to any updates concerning the open requests, by email, SMS and in-application notifications.

The application will allow the user to send attachments using different sources: local file system, cloud, camera and phone scanner.

