L-applikazzjoni tal-intitolament tas-saħħa f’Malta tista' tintuża miċ-ċittadin biex jinteraġixxi mal-Ministeru għas-Saħħa u l-Fornituri tal-Kura tas-Saħħa f’Malta għal diversi każijiet:
       •      Titlob, Iġġedded, Tikkanċella l-EHIC;
       •      Titlob, Tikkanċella l-RHA;
       •      Tiċċekkja l-Eliġibilità;
       •      Titlob għall-Informazzjoni.

L-applikazzjoni se tippermetti liċ-ċittadin jibgħat talbiet lill-Ministeru għas-Saħħa biex iżomm kont tal-progress u l-istat tat-talbiet, kif ukoll biex jinteraġixxi mal-ministeru permezz tat-trasferiment tal-formoli u annessi elettroniċi.

L-applikazzjoni se tinforma liċ-ċittadin fir-rigward ta' kwalunkwe aġġornament dwar it-talbiet miftuħa, permezz ta' email, SMS u notifiki ta 'l-applikazzjoni.

L-applikazzjoni tippermetti lill-klijent jibgħat annessi permezz ta 'sorsi differenti: sistema tal-fajl lokali, ‘cloud’, kamera u skaner tal-mowbajl.
